import {Dialog, withStyles} from '@material-ui/core';

const style = {
    dialogPaper: {
        height: '95%',
        width: '91%',
        overflow: 'hidden',
        borderRadius: 'none',
        maxHeight: '100%',
        maxWidth: '100%'
    }
}

const ChatBox = ({ classes }) => {
    return (
        <Dialog
            open={true}
            classes={{ paper: classes.dialogPaper }}
        >
            Hellooo
        </Dialog>
    )
}

export default withStyles(style)(ChatBox);
